async def main(loop, targets):
    try:
        for target in targets:
            info = await loop.getnameinfo((target, 433))
            print('{:15}: {}'.format(target, info))
    except socket.gaierror:
        print('Could not resolve address: {}'.format(target))

event_loop = asyncio.get_event_loop()
try:
    start = time.time()
    event_loop.run_until_complete(main(event_loop, TARGETS))
    print('Resolved {} hosts in {} seconds.'.format(len(TARGETS), time.time() - start))
finally:
    event_loop.close()
